(Cell c : bCells) g[c.x][c.y] = 1;\r\n\r\n        int[] dx = {-1, 0, 1, 0}, dy = {0, 1, 0, -1};\r\n\r\n        for(int i = 0 ; i < 4 ; i ++){\r\n            int x = aCells.get(aCells.size() - 1).x + dx[i];\r\n            int y = aCells.get(aCells.size() - 1).y + dy[i];\r\n            if(x >= 0 && x < 13 && y >= 0 && y < 14 && g[x][y] == 0){\r\n                return i;\r\n            }\r\n        }\r\n        return 0;\r\n    }\r\n}\r\n', '2022-10-13 19:53:06', '2022-10-16 21:30:35');
